    titleName.addEventListener('click',()   => {
      titleName.style.color = "red";
      console.log("color changed");
    })
  }
  return (
    <div className="App">
      <header>
        <h1 id='name'>Shahzer Baig</h1>
        <a><img></img></a>
      </header>
